import React, { useState } from "react";
import "../index.css";

import Contact from "./contact";
import About from "./about";

export default function Header() {
  const [about, setAbout] = useState(false);
  const [portfolio, setPortfolio] = useState(false);
  const [contact, setContact] = useState(false);

  const toggleAbout = () => setAbout(!about);
  const togglePortfolio = () => setPortfolio(!portfolio);
  const toggleContact = () => setContact(!contact);

  return (
    <>
      <div className="header">
        <h1>Robert Girardin | Front End Developer</h1>
        <div className="links">
          <h1 onClick={toggleAbout}>About</h1>
          <h1 onClick={togglePortfolio}>Portfolio</h1>
          <h1>
            <a
              target="_blank"
              rel="noopener noreferrer"
              href="https://drive.google.com/uc?export=download&id=1MuTUti9eAbvmtat6PlxtwZOqqqaFJCxw"
            >
              Resume
            </a>
          </h1>
          <h1
            onClick={() => {
              toggleContact();
              setAbout(false);
            }}
          >
            Contact
          </h1>
        </div>
      </div>
      <div className="spacer" />
      {contact && <Contact />}
      {about && <About />}
    </>
  );
}
